import React from "react";
import Meta from "../components/Meta";
import BreadCrumb from "../components/BreadCrumb";

const AboutusPage = () => {
  return (
    <div>
      <Meta title="About-us" />
      <BreadCrumb title="About Us" />
      <h1>this is about us page</h1>
    </div>
  );
};

export default AboutusPage;
